    font-family: 'NanumSquareOTF', sans-serif;
    font-size: 1.25em;
    font-weight: 800;
`;

const Publisher = styled.span`
    font-family: 'NanumSquareOTF', sans-serif;
    font-size: 0.938;
    font-weight: 400;
`;
const BookList = ({img, title, publisher}) => {
    return(
        <Books>
            <Img src={img}></Img>
            <Title>{title}</Title>
            <Publisher>{publisher}</Publisher>
        </Books>

    );
}

export default BookList;
